import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
  AreaChart,
  Area,
  PieChart,
  Pie,
} from "recharts";

const PieChartDiagram = () => {
  return (
    <div className=" justify-content-center align-items-center">
      <ResponsiveContainer width="100%" aspect={2}>
        <PieChart width={730} height={250}>
          <Pie
            dataKey="fees"
            isAnimationActive={true}
            cx="50%"
            cy={400}
            outerRadius={300}
            fill="#8884d8"
            label
            data={Data}
            nameKey="name"
          />
          <Pie
            data={Data}
            dataKey="student"
            cx="50%"
            cy={400}
            innerRadius={70}
            outerRadius={90}
            fill="#82ca9d"
            label
          />
          <Tooltip itemStyle={{ color: "green" }} />
        </PieChart>
      </ResponsiveContainer>
    </div>
  );
};

export default PieChartDiagram;
